import React from "react"
import trashIcon from './img/trash-icon.svg';
import editIcon from './img/edit-icon.svg';


const ListItem =({ date, name, description, assigned, status }) => {
    return(
        <div>
            <div className="list-all-text-content">
                <div className="list-tetx">
                    <p>{date}</p>
                    <p>{name}</p>
                    <p>{description}</p>
                    <p>{assigned}</p>
                    <p>{status}</p>
                </div>
            </div>
            <div className="list-all-text-content-button">
                <button className="desktopDeleteButton"><img src={(trashIcon)} /></button>
                <button className="edit-button"><img src={(editIcon)} /></button>
            </div>
        </div>
    )
}

export default ListItem;
